import React, { Component } from 'react'

export default class Postform extends Component {
    render() {
        return (
            <div>
                <h1>Add post</h1>
                <form>
                    <div>
                        <label>Title</label> <br/>
                        <input type='text'></input>
                    </div>

                    <div>
                        <label>Body</label> <br/>
                        <textarea name='body' ></textarea>
                    </div>

                </form>
            </div>
        )
    }
}
